import React, { Component } from 'react';
class App extends Component {
  state = {data: []}
  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/posts?userId='+1).then(res => res.json()).then((data) => {
      this.setState({ data: data })
      console.log(this.state.data)
    })
    .catch(console.log)
  }
  render() {    
    return (
      <div className="container">
        <div class="navbar-header">
			    <button type="button" class="navbar-toggle navbar-toggle-sidebar collapsed">MENU</button>
          <button type="button" class="navbar-toggle collapsed" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1">
            <span class="sr-only">Toggle navigation</span>
            <span class="icon-bar"></span>
            <span class="icon-bar"></span>
            <span class="icon-bar"></span>
          </button>
          <a class="navbar-brand" href="#">Administrator</a>
		</div>


        <div className="col-xs-12">
          <h1>Json Listing Data</h1>
          <table width="100%" className="table table-bordered">
            <thead>
              <tr>
                <th width="8%">Sr No.</th>
                <th width="32%">Name</th>
                <th width="60%">Description</th>
              </tr>
            </thead>
            <tbody>
              {this.state.data.map((item, i) => (
                <tr className="card-body" key={i}>
                  <td width="8%" className="card-title">{item.id}</td>
                  <td width="32%" className="card-title">{item.title}</td>
                  <td width="60%" className="card-subtitle mb-2 text-muted">{item.body}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}
export default App;
